import React,{Component} from "react"

export const Grid = (arr) => {

    return(
        <>
            <div>
                {this.props.arr.map((row) => {
                    <div>
                        {row.map((node) => {
                            return node
                        })}
                    </div>
                })}
            </div>
        </>
    )
}
